 (479,'2006-07-03 00:20:24','2006-07-03 00:20:24',NULL,'2006-07-03 00:20:24',38,38,127,NULL,5,'Describes alternatives to traditional, standardized, norm- or criterion-referenced traditional paper and pencil testing. An alternative assessment might require students to answer an open-ended question, work out a solution to a problem, perform a demonstration of a skill, or in some way produce work rather than select an answer from choices on a sheet of paper. Portfolios and instructor observation of students are also alternative forms of assessment. (New Horizons)',18,NULL,'en',1),
 (480,'2006-07-03 00:21:26','2006-07-03 00:21:26',NULL,'2006-07-03 00:21:26',38,38,127,NULL,1,'Assessment alternatives',18,NULL,'en',1),
 (481,'2006-07-03 00:24:46','2006-07-03 00:24:46',NULL,'2006-07-03 00:24:46',38,38,133,NULL,5,'Evaluating by asking for the behavior the learning is intended to produce. The concept of model, practice, feedback in which students know what excellent performance is and are guided to practice an entire concept rather than bits and pieces in preparation for eventual understanding. A variety of techniques can be employed in authentic assessment. (New Horizons)',18,NULL,'en',1),
 (482,'2006-07-03 00:26:26','2006-07-03 00:26:26',NULL,'2006-07-03 00:26:26',38,38,128,NULL,5,'Direct and frequent measurement of student performance on the classroom curriculum in order to ascertain student instructional needs -- used principally for instructional decision\r\nmaking, the approach also supports screening, placement, and monitoring in special education. (note: see also the identifier \"curriculum related testing\") (ERIC)',18,NULL,'en',1),
 (485,'2006-07-03 00:32:50','2006-07-03 00:32:50',NULL,'2006-07-03 00:32:50',38,38,129,NULL,5,'Appraisal of an individual\'s or group\'s status or growth by means other than standardized instruments. (ERIC)',18,NULL,'en',1),
 (486,'2006-07-03 00:33:24','2006-07-03 00:33:24',NULL,'2006-07-03 00:33:24',38,38,134,NULL,5,'Directed or intentional examination of persons, situations, or things to obtain information -- includes the quantified values by which observed facts are represented. (ERIC)',18,NULL,'en',1),
 (487,'2006-07-03 00:33:50','2006-07-03 00:33:50',NULL,'2006-07-03 00:33:50',38,38,130,NULL,5,'Evaluation by one\'s peers. (ERIC)',18,NULL,'en',1),
 (488,'2006-07-03 00:34:20','2006-07-03 00:34:20',NULL,'2006-07-03 00:34:20',38,38,135,NULL,5,'Systematic collection of a student\'s work samples, records of observation, test results, etc., over a period of time for the purpose of evaluating student growth and achievement -- used occasionally with populations other than students. (note: prior to dec94, \"portfolios (background materials)\" was used, usually with \"student evaluation,\" to index this concept) (ERIC)',18,NULL,'en',1),
 (489,'2006-07-03 00:35:33','2006-07-03 00:35:33',NULL,'2006-07-03 00:35:33',38,38,131,NULL,5,'Assessment of an institution, organization, program, etc., by its members or sponsors. ',18,NULL,'en',1),
 (490,'2006-07-03 00:35:59','2006-07-03 00:35:59',NULL,'2006-07-03 00:35:59',38,38,136,NULL,5,' Tests for which content has been selected and checked empirically, norms have been established, uniform methods of administering have been developed, and which may be scored with a relatively high degree of objectivity. (ERIC)',18,NULL,'en',1),
 (491,'2006-07-03 00:36:26','2006-07-03 00:36:26',NULL,'2006-07-03 00:36:26',38,38,132,NULL,5,'Gathering and processing information about individuals\' ability, skill, understanding, or knowledge under controlled conditions. (note: see also \"evaluation\" and \"measurement\") (ERIC)',18,NULL,'en',1),
