 (604,'2006-07-10 17:54:09','2006-07-10 17:54:09',NULL,'2006-07-10 17:54:09',38,38,176,NULL,5,'All administrators include the integration of 21st Century Skills as part of their overall vision for student achievement and act as role models for such integration, as well as create broad and inclusive plans that integrate 21st Century Skills into every aspect of learning, teaching and administrating.',19,NULL,'en',1),
 (605,'2006-07-10 17:55:17','2006-07-10 17:55:17',NULL,'2006-07-10 17:55:17',38,38,177,NULL,5,'21st Century Tools are equitably distributed and there is access through homes, community centers, libraries and after-school programs, and students have access to environments that advance 21st Century Skills.',19,NULL,'en',1),
 (606,'2006-07-10 17:56:06','2006-07-10 17:56:06',NULL,'2006-07-10 17:56:06',38,38,178,NULL,5,'District resource allocation plans are structured to provide students, parents, teachers and administrators with seamless access to 21st Century Tools and technology in school, at home and any other place where learning activities are envisioned.',19,NULL,'en',1),
 (607,'2006-07-10 17:57:11','2006-07-10 17:57:11',NULL,'2006-07-10 17:57:11',38,38,179,NULL,5,'Infrastructure plans are structured to provide students, parents, teachers and administrators with seamless access to 21st Century Tools and technology in school, there is a process for handling technology support, and all technology is refreshed every three to four years.',19,NULL,'en',1),
 (608,'2006-07-10 17:57:54','2006-07-10 17:57:54',NULL,'2006-07-10 17:57:54',38,38,180,NULL,5,'Administrators regularly use innovative management techniques, data-driven decision making and 21st Century Tools, and all administrators are proficient in the use of 21st Century Tools in the creation of curriculum and assessment.',19,NULL,'en',1),
 (609,'2006-07-10 17:58:30','2006-07-10 17:58:30',NULL,'2006-07-10 17:58:30',38,38,181,NULL,5,'All curriculum, educational objectives and standards are aligned with assessment and include 21st Century skills and encourage the integration of 21st Century skills into both content mastery and administrative processes.',19,NULL,'en',1),
 (610,'2006-07-10 17:59:40','2006-07-10 17:59:40',NULL,'2006-07-10 17:59:40',38,38,182,NULL,5,'All schools and districts are evaluated on student achievement of 21st Century Skills, the systemic incorporation of 21st Century Skills, the efficiency of educational programs, and professional development programs that include 21st Century Skills.',19,NULL,'en',1),
 (611,'2006-07-10 18:00:18','2006-07-10 18:00:18',NULL,'2006-07-10 18:00:18',38,38,183,1,19,'Parents',NULL,NULL,'en',1),
