 (614,'2006-07-10 18:01:11','2006-07-10 18:01:11',NULL,'2006-07-10 18:01:11',38,38,183,NULL,5,'Parents, students and teachers collaborate to create an education that includes the mastery of core subjects and 21st Century Skills, 21st Century Tools are used to facilitate dialogue, and most parents have a mastery of 21st Century Tools',19,NULL,'en',1),
