 (622,'2006-07-10 18:04:11','2006-07-10 18:04:11',NULL,'2006-07-10 18:04:11',38,38,185,NULL,5,'K-12 schools and higher education programs regularly work together to prepare students for college, including the integration of content and 21st Century Skills.',19,NULL,'en',1),
 (623,'2006-07-10 18:04:48','2006-07-10 18:04:48',NULL,'2006-07-10 18:04:48',38,38,186,1,19,'Content Providers',NULL,NULL,'en',1),
