 (626,'2006-07-10 18:05:50','2006-07-10 18:05:50',NULL,'2006-07-10 18:05:50',38,38,186,NULL,5,'Content providers create content and resources that include standards with 21st Century Skills and education leaders work with content providers to develop aligned resources, assessment and curriculum integrated with the appropriate 21st Century Tools and educational systems.',19,NULL,'en',1),
 (627,'2006-07-10 18:06:24','2006-07-10 18:06:24',NULL,'2006-07-10 18:06:24',38,38,187,1,19,'Business',NULL,NULL,'en',1),
