 (629,'2006-07-10 18:06:49','2006-07-10 18:06:49',NULL,'2006-07-10 18:06:49',38,38,187,NULL,3,'http://purl.org/ASN/scheme/P21/concepts#Partnering',19,139,'en',1),
 (630,'2006-07-10 18:07:07','2006-07-10 18:07:07',NULL,'2006-07-10 18:07:07',38,38,187,NULL,5,'K-12 and private sector partners regularly work together to ensure student preparation for the workplace and the mastery of 21st Century Skills, and businesses regularly support educational programs that promote 21st Century Skills.',19,NULL,'en',1),
 (631,'2006-07-10 18:08:52','2006-07-10 18:08:52',NULL,'2006-07-10 18:08:52',38,38,155,NULL,5,'Education and business leaders identified significant emerging content areas that are critical to success in communities and workplaces.',19,NULL,'en',1),
 (632,'2006-07-10 18:09:43','2006-07-10 18:09:43',NULL,'2006-07-10 18:09:43',38,38,154,NULL,5,'Students need to learn academic content through real-world examples, applications and experiences both inside and outside of school. Students are better learners when education is relevant, engaging and meaningful to their lives--they understand subjects better and retain more information.',19,NULL,'en',1),
 (633,'2006-07-10 18:14:10','2006-07-10 18:14:10',NULL,'2006-07-10 18:14:10',38,38,173,NULL,5,'All assessments are learner-centered, formative, content specific, ongoing and rooted in teaching strategies and most assessments use technology.',19,NULL,'en',1),
 (635,'2006-07-10 18:19:42','2006-07-10 18:19:42',NULL,'2006-07-10 18:19:42',38,38,160,NULL,5,'Information and Media Literacy: Analyzing, accessing, managing, integrating, evaluating and creating information in a variety of forms and media. Understanding the role of media in society. Communication Skills: Understanding, managing and creating effective oral, written and multimedia communication in a variety of forms and contexts.',19,NULL,'en',1),
 (636,'2006-07-10 18:20:34','2006-07-10 18:20:34',NULL,'2006-07-10 18:20:34',38,38,164,NULL,5,'Understanding, managing and creating effective oral, written and multimedia communication in a variety of forms and contexts.',19,NULL,'en',1),
 (637,'2006-07-10 18:21:25','2006-07-10 18:21:25',NULL,'2006-07-10 18:21:25',38,38,184,NULL,5,'Community programs support learner mastery of 21st Century Skills and coordinate with school programs to promote strategies that reinforce 21st Century Skills.',19,NULL,'en',1),
 (638,'2006-07-10 18:22:51','2006-07-10 18:22:51',NULL,'2006-07-10 18:22:51',38,38,142,NULL,5,'When students work towards mastery of core subjects, their study includes 21st Century content taught in a 21st Century Context.',19,NULL,'en',1),
 (639,'2006-07-10 18:25:05','2006-07-10 18:25:05',NULL,'2006-07-10 18:25:05',38,38,157,NULL,5,'Financial, economic and business literacy, and developing entrepreneurial skills to enhance workplace productivity and career options.',19,NULL,'en',1),
 (640,'2006-07-10 18:30:19','2006-07-10 18:30:19',NULL,'2006-07-10 18:30:19',38,38,162,NULL,5,'Interpersonal and collaborative skills: Demonstrating teamwork and leadership: adapting to varied roles and responsibilities; working productively with others; exercising empathy; respecting diverse perspectives.  Self Direction: Monitoring one\'s own understanding and learning needs, locating appropriate resources, transferring learning from one domain to another. Accountability and Adaptability: Exercising personal responsibility and flexibility in personal, workplace and community contexts; setting and meeting high standards and goals for one\'s self and others; tolerating ambiguity.  Social Responsibility: Acting responsibly with the interests of the larger community in mind; demonstrating ethical behavior in personal, workplace and community contexts.',19,NULL,'en',1),
 (641,'2006-07-10 18:34:27','2006-07-10 18:34:27',NULL,'2006-07-10 18:34:27',38,38,172,NULL,5,'In a digital world, students need to learn to use the tools to master the learning skills that are essential to everyday life and workplace productivity. This proficiency is known as ICT Literacy.',19,NULL,'en',1),
 (642,'2006-07-10 18:36:22','2006-07-10 18:36:22',NULL,'2006-07-10 18:36:22',38,38,174,NULL,5,'Teachers act as facilitators and partners for teaching and learning, all teachers use adaptable and flexible teaching strategies.',19,NULL,'en',1),
 (643,'2006-07-10 18:38:34','2006-07-10 18:38:34',NULL,'2006-07-10 18:38:34',38,38,175,NULL,5,'Professional development supports the application of 21st Century Skills in teaching and learning strategies and classroom management practices,and teachers use professional development to reinforce their content competency and integrate 21st Century Skills.',19,NULL,'en',1),
 (644,'2006-07-10 18:39:42','2006-07-10 18:39:42',NULL,'2006-07-10 18:39:42',38,38,169,NULL,5,' Monitoring one\'s own understanding and learning needs, locating appropriate resources, transferring learning from one domain to another. \r\n',19,NULL,'en',1),
 (645,'2006-07-10 18:41:35','2006-07-10 18:41:35',NULL,'2006-07-10 18:41:35',38,38,171,NULL,5,'Acting responsibly with the interests of the larger community in mind; demonstrating ethical behavior in personal, workplace and community contexts.',19,NULL,'en',1),
 (646,'2006-07-10 18:42:37','2006-07-10 18:42:37',NULL,'2006-07-10 18:42:37',38,38,161,NULL,5,'Critical Thinking and Systems Thinking: Exercising sound reasoning in understanding and making complex choices, understanding the interconnections among systems. Problem Identification, Formulation and Solution: Ability to frame, analyze and solve problems. Creativity and Intellectual Curiosity: Developing, implementing and communicating new ideas to others, staying open and responsive to new and diverse perspectives.',19,NULL,'en',1),
