 (828,'2006-07-02 16:09:40','added',469,127,18,19,'Alternative assessment',NULL,NULL,'en',1,38,NULL),
 (829,'2006-07-03 00:20:24','added',479,127,18,5,'Describes alternatives to traditional, standardized, norm- or criterion-referenced traditional paper and pencil testing. An alternative assessment might require students to answer an open-ended question, work out a solution to a problem, perform a demonstration of a skill, or in some way produce work rather than select an answer from choices on a sheet of paper. Portfolios and instructor observation of students are also alternative forms of assessment. (New Horizons)',18,NULL,'en',1,38,NULL),
 (830,'2006-07-03 00:21:26','added',480,127,18,1,'Assessment alternatives',18,NULL,'en',1,38,NULL),
 (833,'2006-07-02 20:39:59','added',475,133,18,19,'Authentic assessment',NULL,NULL,'en',1,38,NULL),
 (834,'2006-07-03 00:24:46','added',481,133,18,5,'Evaluating by asking for the behavior the learning is intended to produce. The concept of model, practice, feedback in which students know what excellent performance is and are guided to practice an entire concept rather than bits and pieces in preparation for eventual understanding. A variety of techniques can be employed in authentic assessment. (New Horizons)',18,NULL,'en',1,38,NULL),
 (837,'2006-07-02 20:35:36','added',470,128,18,19,'Curriculum based assessment',NULL,NULL,'en',1,38,NULL),
 (838,'2006-07-03 00:26:26','added',482,128,18,5,'Direct and frequent measurement of student performance on the classroom curriculum in order to ascertain student instructional needs -- used principally for instructional decision\r\nmaking, the approach also supports screening, placement, and monitoring in special education. (note: see also the identifier \"curriculum related testing\") (ERIC)',18,NULL,'en',1,38,NULL),
 (841,'2006-07-02 20:36:17','added',471,129,18,19,'Informal assessment',NULL,NULL,'en',1,38,NULL),
 (842,'2006-07-03 00:32:50','added',485,129,18,5,'Appraisal of an individual\'s or group\'s status or growth by means other than standardized instruments. (ERIC)',18,NULL,'en',1,38,NULL),
 (845,'2006-07-02 20:41:02','added',476,134,18,19,'Observation',NULL,NULL,'en',1,38,NULL),
 (846,'2006-07-03 00:33:24','added',486,134,18,5,'Directed or intentional examination of persons, situations, or things to obtain information -- includes the quantified values by which observed facts are represented. (ERIC)',18,NULL,'en',1,38,NULL),
 (849,'2006-07-02 20:36:43','added',472,130,18,19,'Peer evaluation',NULL,NULL,'en',1,38,NULL),
 (850,'2006-07-03 00:33:50','added',487,130,18,5,'Evaluation by one\'s peers. (ERIC)',18,NULL,'en',1,38,NULL),
 (853,'2006-07-02 20:41:53','added',477,135,18,19,'Portfolio assessment',NULL,NULL,'en',1,38,NULL),
 (854,'2006-07-03 00:34:20','added',488,135,18,5,'Systematic collection of a student\'s work samples, records of observation, test results, etc., over a period of time for the purpose of evaluating student growth and achievement -- used occasionally with populations other than students. (note: prior to dec94, \"portfolios (background materials)\" was used, usually with \"student evaluation,\" to index this concept) (ERIC)',18,NULL,'en',1,38,NULL),
